    <style>
        :root {
            --primary-blue: #2659BF;
            --text-dark: #1f2937;
            --text-gray: #6b7280;
            --bg-gray: #FAFAFA;
            --card-bg: #ffffff;
        }

        * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
            -webkit-tap-highlight-color: transparent;
        }

        body {
            font-family: 'IranSansX', 'Genos', sans-serif;
            background-color: #e5e5e5;
            /* Outer background */
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
        }

        /* Mobile Container */
        .app-container {
            width: 100%;
            max-width: 450px;
            height: 100vh;
            background-color: var(--bg-gray);
            position: relative;
            display: flex;
            flex-direction: column;
            overflow: hidden;
            user-select: none;
        }

        /* Header */
        .header {
            background: var(--card-bg);
            padding: 15px 20px;
            margin: 15px;
            border-radius: 12px;
            display: flex;
            justify-content: space-between;
            align-items: center;
            flex-shrink: 0;
            border: #0000001a 0.5px solid;
        }

        .header-title {
            display: flex;
            align-items: center;
            gap: 8px;
            color: var(--text-dark);
            font-weight: 700;
            font-size: 1.1rem;
        }

        .logo-icon {
            width: 30px;
            height: 20px;
            /* Simple CSS eye/cup shape for logo */
            background: radial-gradient(circle at center, #3b82f6 3px, transparent 4px),
                radial-gradient(ellipse at center, transparent 40%, #3b82f6 45%, #3b82f6 50%, transparent 55%);
        }

        .back-btn {
            font-size: 1.2rem;
            color: var(--text-dark);
            cursor: pointer;
            display: flex;
        }

        /* Tabs */
        .tabs {
            background: var(--card-bg);
            margin: 0 15px 0 15px;
            border-radius: 12px 12px 0 0;
            display: flex;
            justify-content: space-around;
            flex-shrink: 0;
            border: #0000001a 0.5px solid;
            overflow-x: scroll;
            scrollbar-width: none;
        }

        .tab-item {
            margin-left: 17.5px;
            padding: 25px 17.5px;
            font-size: 0.85rem;
            color: var(--text-dark);
            display: flex;
            align-items: center;
            gap: 10px;
            cursor: pointer;
            border-bottom: 1.5px solid transparent;
            font-weight: 600;
            white-space: nowrap;
        }

        .tab-item-last {
            margin-left: 0;
        }

        .tab-item.active {
            color: var(--primary-blue);
            border-bottom-color: var(--primary-blue);
        }

        .tab-item.active object {
            color: var(--primary-blue);
        }

        .tab-item-icon {
            width: 18px;
            height: 18px;
        }

        /* Menu Items */
        .menu-item {
            padding-bottom: 22px;
            padding-top: 34px;
            font-size: 0.95rem;
            color: var(--text-dark);
            display: flex;
            align-items: center;
            gap: 10px;
            white-space: nowrap;
            font-weight: 800;
        }

        .menu-item-icon {
            width: 22px;
            height: 22px;
            color: var(--primary-blue);
        }

        /* Scrollable List */
        .menu-list {
            flex-grow: 1;
            overflow-y: auto;
            margin: 0 15px 20px 15px;
            /* Hide Scrollbar */
            scrollbar-width: none;
            /* Firefox */
            background: white;
            padding: 0 15px;
            -ms-overflow-style: none;
            /* IE/Edge */
        }

        .menu-list::-webkit-scrollbar {
            display: none;
            /* Chrome/Safari */
        }

        /* Menu Card */
        .card {
            background: var(--card-bg);
            border-radius: 16px;
            padding: 16px 20px 16px 0;
            margin-bottom: 16px;
            display: flex;
            flex-direction: column;
            border: #0000001a 0.5px solid;
        }

        .card-main {
            display: flex;
            justify-content: space-between;
            align-items: center;
        }

        .card-last {
            margin-bottom: 0;
        }

        .card-img {
            width: 86px;
            height: 86px;
            background: #BFBFBF29;
            display: flex;
            align-items: center;
            justify-content: center;
            border-radius: 8px;
        }

        .card-img img {
            width: 46px;
            height: 36px;
        }

        .card-info {
            flex: 1;
            height: 86px;
        }

        .item-title {
            font-weight: 700;
            font-size: 0.8rem;
            color: #000;
            margin-bottom: 4px;
            text-align: center;
        }

        .item-subtitle {
            font-size: 0.8rem;
            color: var(--primary-blue);
            text-transform: capitalize;
            margin-bottom: 12px;
            letter-spacing: 0.5px;
            text-align: center;
        }

        .price-row {
            display: flex;
            gap: 60px;
            margin-bottom: 12px;
            justify-content: center;
            text-align: center;
        }

        .price-col {
            display: flex;
            flex-direction: column;
            gap: 4px;
        }

        .price-label {
            font-size: 0.7rem;
            color: #000;
            font-weight: 500;
        }

        .price-value {
            font-size: 0.65rem;
            color: #000;
            font-weight: 500;
        }

        .item-desc {
            font-size: 0.6rem;
            color: var(--text-dark);
            line-height: 1.4;
            margin-top: 16px;
            font-weight: 500;
        }
    </style>
</head>

<script>
    // Wait for DOM to be fully loaded
    document.addEventListener('DOMContentLoaded', function () {
        // Get all tab items and category sections
        const tabs = document.querySelectorAll('.tab-item');
        const menuList = document.querySelector('.menu-list');
        const tabsContainer = document.querySelector('.tabs');

        // Flags to control observer behavior
        let disableObserver = false;
        let isManualScroll = false;
        let manualScrollTimeout = null;

        // Set the first tab as active by default
        if (tabs.length > 0) {
            tabs[0].classList.add('active');
            // Scroll to first tab initially
            setTimeout(() => scrollTabIntoView(tabs[0]), 100);
        }

        // Function to remove active class from all tabs
        function removeActiveClass() {
            tabs.forEach(tab => {
                tab.classList.remove('active');
            });
        }

        // Function to scroll tabs container to make active tab visible
        function scrollTabIntoView(activeTab) {
            if (!activeTab || !tabsContainer) return;

            const containerWidth = tabsContainer.clientWidth;
            const tabWidth = activeTab.offsetWidth;
            const tabRight = activeTab.offsetLeft + tabWidth;

            // Position the active tab at the far right of the navbar
            // We want the right edge of the tab to align with the right edge of the container
            const newScrollLeft = tabRight - containerWidth;

            // Smooth scroll the tabs container
            tabsContainer.scrollTo({
                left: newScrollLeft,
                behavior: 'smooth'
            });
        }

        // Function to scroll to a specific category
        function scrollToCategory(category) {
            // Disable observer temporarily to prevent bouncing
            disableObserver = true;
            isManualScroll = true;

            // Find the first element with this category class
            const targetElements = document.querySelectorAll(`.${category}`);
            if (targetElements.length > 0) {
                // Get the first element in the category
                const targetElement = targetElements[0];

                // Update active tab immediately
                removeActiveClass();
                // Find and activate the corresponding tab
                let activeTab = null;
                tabs.forEach(tab => {
                    if (tab.getAttribute('data-target') === category) {
                        tab.classList.add('active');
                        activeTab = tab;
                    }
                });

                // Scroll tabs container to make active tab visible
                if (activeTab) {
                    scrollTabIntoView(activeTab);
                }

                // Smooth scroll to the category with callback
                targetElement.scrollIntoView({
                    behavior: 'smooth',
                    block: 'start'
                });

                // Re-enable observer after scroll completes
                setTimeout(() => {
                    disableObserver = false;
                    isManualScroll = false;
                }, 800); // Slightly longer than scroll animation

                // Return true if successful
                return true;
            }
            return false;
        }

        // Function to get category from element
        function getElementCategory(element) {
            // Check for category classes
            const categoryClasses = [
                'espressobar', 'brewedcoffee', 'icedcoffee', 'teaandinfusion',
                'hotdrinks', 'mocktailandsmoothie', 'milkshake', 'breakfast',
                'salad', 'sandwich', 'dessertandcake'
            ];

            for (const category of categoryClasses) {
                if (element.classList.contains(category)) {
                    return category;
                }
            }
            return null;
        }

        // Add click event listeners to tabs
        tabs.forEach(tab => {
            tab.addEventListener('click', function (e) {
                e.preventDefault();
                const category = this.getAttribute('data-target');
                if (category) {
                    scrollToCategory(category);
                }
            });
        });

        // Scroll spy functionality using Intersection Observer
        const observerOptions = {
            root: menuList,
            rootMargin: '0px 0px 0px 0px',
            threshold: [0]
        };

        // Map to store category elements for scroll spy
        const categoryElements = new Map();

        // Get all category sections
        const categoryClasses = [
            'espressobar', 'brewedcoffee', 'icedcoffee', 'teaandinfusion',
            'hotdrinks', 'mocktailandsmoothie', 'milkshake', 'breakfast',
            'salad', 'sandwich', 'dessertandcake'
        ];

        // Collect all elements for each category
        categoryClasses.forEach(category => {
            const elements = document.querySelectorAll(`.${category}`);
            if (elements.length > 0) {
                // Use the first element that's likely to be visible
                categoryElements.set(category, elements[0]);
            }
        });

        // Create Intersection Observer
        const observer = new IntersectionObserver((entries) => {
            // Skip if observer is disabled (during manual navigation)
            if (disableObserver) return;

            // Debounce observer calls
            clearTimeout(manualScrollTimeout);
            manualScrollTimeout = setTimeout(() => {
                let mostVisibleEntry = null;
                let highestIntersection = 0;

                // Find the most visible category
                entries.forEach(entry => {
                    if (entry.isIntersecting) {
                        const intersectionRatio = entry.intersectionRatio;
                        // Only consider entries with significant visibility
                        if (intersectionRatio > 0.5 && intersectionRatio > highestIntersection) {
                            highestIntersection = intersectionRatio;
                            mostVisibleEntry = entry;
                        }
                    }
                });

                // If we have a clearly visible category, update active tab
                if (mostVisibleEntry && highestIntersection > 0.5) {
                    const element = mostVisibleEntry.target;
                    const category = getElementCategory(element);

                    if (category) {
                        removeActiveClass();
                        let activeTab = null;

                        tabs.forEach(tab => {
                            if (tab.getAttribute('data-target') === category) {
                                tab.classList.add('active');
                                activeTab = tab;
                            }
                        });

                        // Scroll tabs container to make active tab visible
                        if (activeTab && !isManualScroll) {
                            setTimeout(() => scrollTabIntoView(activeTab), 100);
                        }
                    }
                }
            }, 50); // Small debounce delay
        }, observerOptions);

        // Observe each category element
        categoryElements.forEach(element => {
            if (element) {
                observer.observe(element);
            }
        });

        // Improved scroll event listener with better debouncing
        let scrollTimeout;
        let lastScrollTop = menuList.scrollTop;
        let scrollDirection = 'down';

        menuList.addEventListener('scroll', function () {
            // Update scroll direction
            const currentScrollTop = menuList.scrollTop;
            scrollDirection = currentScrollTop > lastScrollTop ? 'down' : 'up';
            lastScrollTop = currentScrollTop;

            // Skip if observer is disabled (during manual navigation)
            if (disableObserver) return;

            clearTimeout(scrollTimeout);
            scrollTimeout = setTimeout(function () {
                const scrollPosition = menuList.scrollTop + (scrollDirection === 'down' ? 200 : 100);

                let currentCategory = null;
                let closestDistance = Infinity;

                // Find which category is currently most visible
                categoryElements.forEach((element, category) => {
                    if (!element) return;

                    const elementTop = element.offsetTop;
                    const elementHeight = element.offsetHeight;
                    // const elementCenter = elementTop + (elementHeight / 2);

                    // Calculate distance from viewport center
                    const distance = Math.abs((elementTop) - scrollPosition);

                    // Prefer categories that are closer to viewport center
                    if (distance < closestDistance) {
                        closestDistance = distance;
                        currentCategory = category;
                    }
                });

                // Only update if we found a category and it's not during manual scroll
                if (currentCategory && !isManualScroll) {
                    removeActiveClass();
                    let activeTab = null;

                    tabs.forEach(tab => {
                        if (tab.getAttribute('data-target') === currentCategory) {
                            tab.classList.add('active');
                            activeTab = tab;
                        }
                    });

                    // Scroll tabs container to make active tab visible
                    if (activeTab) {
                        setTimeout(() => scrollTabIntoView(activeTab), 100);
                    }
                }
            }, 150); // Increased debounce time
        });

        // Handle window resize to recalculate positions
        let resizeTimeout;
        window.addEventListener('resize', function () {
            clearTimeout(resizeTimeout);
            resizeTimeout = setTimeout(function () {
                // Re-observe elements after resize
                categoryElements.clear();
                categoryClasses.forEach(category => {
                    const elements = document.querySelectorAll(`.${category}`);
                    if (elements.length > 0) {
                        categoryElements.set(category, elements[0]);
                    }
                });

                // Re-observe with updated positions
                observer.disconnect();
                categoryElements.forEach(element => {
                    if (element) {
                        observer.observe(element);
                    }
                });
            }, 250);
        });

        // Initialize by checking current scroll position
        setTimeout(() => {
            menuList.dispatchEvent(new Event('scroll'));
        }, 500);

        // Add a fallback to ensure observer gets re-enabled
        setInterval(() => {
            // If observer has been disabled for too long (e.g., due to an error), re-enable it
            if (disableObserver && !isManualScroll) {
                disableObserver = false;
            }
        }, 3000);
    });
</script>
<script>
    (function () {
        const sameOrigin = url => new URL(url, location.href).origin === location.origin;
        async function visit(u, push = true) {
            try {
                const res = await fetch(u, { credentials: 'include' });
                if (!res.ok) return location.href = u;
                const text = await res.text();
                // Replace entire document
                document.open();
                document.write(text);
                document.close();
                if (push) history.pushState(null, '', u);
            } catch (e) { location.href = u; }
        }
        document.addEventListener('click', e => {
            if (e.defaultPrevented || e.button !== 0 || e.metaKey || e.ctrlKey || e.shiftKey || e.altKey) return;
            const a = e.target.closest('a'); if (!a) return;
            const href = a.getAttribute('href'); if (!href || href.startsWith('#') || href.startsWith('mailto:') || href.startsWith('tel:')) return;
            const url = new URL(href, location.href);
            if (!sameOrigin(url)) return;
            e.preventDefault(); visit(url.href, true);
        }, true);
        window.addEventListener('popstate', () => visit(location.href, false));
    })();
</script>
